window.bookSummaryJSON = "<p>An owl with secrets....</p> <p>Or so Constance thinks. She's having trouble convincing anyone else otherwise.</p> <p>When two bodies are found on the vineyard property, Constance and Dave make a startling discovery. The timeline of the two deaths is off...by a few decades.</p> <p>The first died a whole lot more recently than the other. Dave unearths - literally - a cold case from decades past, which only brings more questions.</p> <p>Is someone using necromancy to do their dirty work? And can Constance and her friends stop them before they become the targets?</p> <p>It's the holiday season in Creel Creek, Virginia. And it's full of mystery, romance, and surprises.</p>"; 
